import React, {useState} from 'react';
import TextInputCustom from "../../../Re-usable/FormComponents/TextInputCustom";
import {useForm} from "react-hook-form";


function FindPatient({onSubmit, onChange}) {

    const messages = {
        "required": " must be at least one character long."
    }

    const registerObject = {
        required: true
    }

    const {register, errors, handleSubmit} = useForm();


    return (
        <div className="find-patient-form-wrapper">

            <h3>Type the patient name then locate him in the bellow list</h3>
            <br/>

            <form className={"find-patient-form"} onSubmit={handleSubmit(onSubmit)}>
                <TextInputCustom field="firstName" label="First Name" errorMessages={messages}
                                 form={{register, errors, registerObject}} onChange={onChange}/>
            </form>

        </div>
    );
}
export default FindPatient;
